import React from "react";
import { makeStyles } from "@material-ui/core";
import { Link } from "react-router-dom";
// import { makeStyles } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import CardMedia from "@material-ui/core/CardMedia";
import Typography from "@material-ui/core/Typography";
import { Collapse } from "@material-ui/core";

const useStyles = makeStyles({
  root: {
    marginTop: "7rem",
    maxWidth: "98%",
    minHeight: 600,
    background: "rgba(0,0,0,0.5)",
    margin: "20px",
  },
  media: {
    height: 440,
  },
  title: {
    fontFamily: "Nunito",
    fontWeight: "bold",
    fontSize: "2rem",
    color: "#fff",
  },
  desc: {
    fontFamily: "Nunito",
    fontSize: "1.1rem",
    color: "#ddd",
  },
});

export default function ImageCard({ place, checked, goto, stateId }) {
  const classes = useStyles();
  let urlLink = "#";
  const { image, name, description, _id } = place;
  // let { image, name, description, _id } = {};
  console.log(place);

  if (goto === "Places") {
    // let { image, name, description, _id } = place;
    urlLink = `/states/${_id}/places`;
  } else if (goto === "PlacesDetails") {
    urlLink = `/states/${stateId}/places/${_id}`;
  } else {
    // let { image, name, description, _id } = place;
    urlLink = `#`;
  }

  // console.log(`${(${goto})}`);
  // console.log(image, name, description);
  return (
    <Collapse in={checked} {...(checked ? { timeout: 1000 } : {})}>
      <Card className={classes.root}>
        <CardMedia
          className={classes.media}
          image={image}
          title="Contemplative Reptile"
        />
        <CardContent>
          <Typography
            gutterBottom
            variant="h5"
            // component="h1"
            className={classes.title}
          >
            {name}
          </Typography>
          <Typography
            variant="body2"
            color="textSecondary"
            component="p"
            className={classes.desc}
          >
            {description}
          </Typography>
        </CardContent>
      </Card>
    </Collapse>
  );
}

